import React from 'react';
import './DroneStatus.css';

const DroneStatus = ({ drones }) => {
  const getStatusColor = (status) => {
    const colors = {
      'assigned': '#3498db',
      'delivering': '#9b59b6',
      'completed': '#27ae60'
    };
    return colors[status] || '#95a5a6';
  };

  const getStatusText = (status) => {
    const statusMap = {
      'assigned': 'Â∑≤ÂàÜÈÖç',
      'delivering': 'È£ûË°å‰∏≠',
      'completed': 'Â∑≤ÂÆåÊàê'
    };
    return statusMap[status] || status;
  };

  const getStatusIcon = (status) => {
    const icons = {
      'assigned': 'üöÅ',
      'delivering': '‚úàÔ∏è',
      'completed': '‚úÖ'
    };
    return icons[status] || 'üöÅ';
  };

  const getAltitudeColor = (altitude) => {
    if (altitude <= 100) return '#27ae60';
    if (altitude <= 150) return '#f39c12';
    return '#e74c3c';
  };

  return (
    <div className="drone-status">
      <div className="status-header">
        <h3>Êó†‰∫∫Êú∫Áä∂ÊÄÅ</h3>
        <span className="drone-count">{drones.length} Êû∂</span>
      </div>

      {drones.length === 0 ? (
        <div className="no-drones">
          <p>ÊöÇÊó†Êó†‰∫∫Êú∫Ê¥ªÂä®</p>
          <span className="drone-icon">üöÅ</span>
        </div>
      ) : (
        <div className="drones-list">
          {drones.map(drone => (
            <div key={drone.id} className="drone-item">
              <div className="drone-header">
                <span className="drone-id">{drone.id}</span>
                <span 
                  className="drone-status-badge"
                  style={{ backgroundColor: getStatusColor(drone.status) }}
                >
                  {getStatusIcon(drone.status)} {getStatusText(drone.status)}
                </span>
              </div>

              <div className="drone-info">
                <div className="info-row">
                  <span className="info-label">ËÆ¢ÂçïID:</span>
                  <span className="info-value">{drone.orderId}</span>
                </div>

                <div className="info-row">
                  <span className="info-label">È´òÂ∫¶:</span>
                  <span 
                    className="info-value altitude"
                    style={{ color: getAltitudeColor(drone.altitude) }}
                  >
                    {drone.altitude}m
                  </span>
                </div>

                <div className="info-row">
                  <span className="info-label">ÈÄüÂ∫¶:</span>
                  <span className="info-value">{drone.speed}m/s</span>
                </div>
              </div>

              {drone.path && drone.path.length > 0 && (
                <div className="path-info">
                  <div className="path-progress">
                    <span className="progress-label">È£ûË°åËøõÂ∫¶:</span>
                    <div className="progress-bar">
                      <div 
                        className="progress-fill"
                        style={{ 
                          width: `${drone.status === 'completed' ? 100 : 
                                  drone.status === 'delivering' ? 50 : 0}%` 
                        }}
                      />
                    </div>
                  </div>
                </div>
              )}
            </div>
          ))}
        </div>
      )}

      {drones.length > 0 && (
        <div className="status-summary">
          <div className="summary-item">
            <span className="summary-label">Â∑≤ÂàÜÈÖç:</span>
            <span className="summary-value">
              {drones.filter(d => d.status === 'assigned').length}
            </span>
          </div>
          <div className="summary-item">
            <span className="summary-label">È£ûË°å‰∏≠:</span>
            <span className="summary-value">
              {drones.filter(d => d.status === 'delivering').length}
            </span>
          </div>
          <div className="summary-item">
            <span className="summary-label">Â∑≤ÂÆåÊàê:</span>
            <span className="summary-value">
              {drones.filter(d => d.status === 'completed').length}
            </span>
          </div>
        </div>
      )}
    </div>
  );
};

export default DroneStatus;
